create database 午餐吃什麼
on primary
( name = '午餐吃什麼',
	filename = 'E:\dbf\午餐吃什麼.mdf',
	size = 10MB,
	maxsize = 100MB,
	filegrowth = 20%
	)
	log on
	( name = '午餐吃什麼_log',
		filename = 'E:\dbf\午餐吃什麼.ldf')
go

use 午餐吃什麼

create table 店家
(
	編號		int primary key,
	名稱		nvarchar(10) not null,
	類型		char(10) not null,
	營業時間	char(10) not null,
	葷素		char(10) not null,
	圖片		char(10) not null,
	評價		int not null,
	價位		int not null,
	電話		char(13) not null,
	地址		nvarchar(50) not null,
	地圖		VARCHAR(500)
)
go

create table 抽選結果
(
	編號		int primary key identity(1,1),
	抽選結果	int  constraint FK_抽選店家編號 references 店家(編號)  not null,
	抽選日期	date default convert(date, getdate()) not null,
	類型篩選	char(10),
	時段篩選	char(10),
	葷素篩選	char(10),
	評價篩選	int not null,
	價位篩選	int not null
)
go

create table 問題回報
(
	編號		int	primary key identity(1,1),
	類型		char(10),
	回報人		nvarchar(10) not null,
	電話		char(13) not null,
	信箱		nvarchar(255),
	問題說明	nvarchar(100)
)

go

go

go

SELECT * FROM 店家
WHERE 
	類型 = '中式'
	AND 營業時間 LIKE '%早上%'
	AND 葷素 = '葷'
	AND 評價 >= 5
	AND 價位 <= 5;
go

SELECT 名稱, 電話, 地址 FROM 店家
WHERE 
	類型 = '中式'
	AND 營業時間 LIKE '%早上%'
	AND 葷素 = '葷'
	AND 評價 >= 5
	AND 價位 <= 5;
go

